import React from "react";
import { useQuery, gql, graphql } from "@apollo/client";

// const USER_QUERY = gql`
//   {
//     users {
//       id
//       name
//       username
//       password
//       picture
//       email
//     }
//   }
// `;
// {
//   id: parent.id;
// }
const USER_QUERY = gql`
  {
    users {
      id
      name
      username
      password
      picture
      email
    }
  }
`;

const GET_USER = gql`
  {
    getUser() {
      id
      name
    }
  }
`;
const LinkList = () => {
  const { data } = useQuery(GET_USER);
  console.log(data);

  return (
    <div className="formpage">
      <h1>Profile</h1>
      <div className="form">
        {/* <div className="wrapper"> */}
        <img
          className="imagecover"
          src="https://www.desicomments.com/dc3/19/439319/4393191.jpg"
        />
        {/* </div> */}
        <h3>Name:</h3>
        <h3>Username:</h3>
        <h3>Email:</h3>
      </div>
      {data && (
        <>
          {data.users.map((user) => (
            <div>
              <div>{user.id}</div>;<div>{user.username}</div>
            </div>
          ))}
        </>
      )}
    </div>
  );
};

export default LinkList;
